package com.fridayfilmworks.movie.loader;

import com.fridayfilmworks.movie.model.Movie;
import com.fridayfilmworks.movie.model.Photo;
import com.fridayfilmworks.movie.repository.MovieRepository;
import com.fridayfilmworks.movie.repository.PhotoRepository;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.data.jpa.repository.JpaRepository;
import org.springframework.stereotype.Component;
import org.springframework.transaction.annotation.Transactional;

import javax.annotation.PostConstruct;
import java.util.ArrayList;
import java.util.List;

@Component
public class MovieLoader {

    @Autowired
    MovieRepository movieRepository;

    @Autowired
    PhotoRepository photoRepository;

    @PostConstruct
    @Transactional
    public void loadAll(){
        System.out.println(("LOADING DATA"));
        movieRepository.saveAll(getData());
        photoRepository.saveAll(getPhotoData());
        System.out.println("LOADING COMPLETE");
    }

    private List<Photo> getPhotoData() {
        List<Photo> photoList = new ArrayList<>();
        photoList.add(new Photo("Sikender", "image/webp", hexStringToByteArray("")));
        photoList.add(new Photo("Azad", "image/jpeg", hexStringToByteArray("")));
        photoList.add(new Photo("Jalsha", "image/jpeg", hexStringToByteArray("")));
        photoList.add(new Photo("Popeye", "image/jpeg", hexStringToByteArray("")));
        photoList.add(new Photo("Dora", "image/jpeg", hexStringToByteArray("")));


        return photoList;
    }


    private List<Movie> getData(){
        List<Movie> movieList = new ArrayList<>();
        String showTimings = "1:30 PM , 2:30 PM, 3:30 PM";
        String theater = "PVR , Wave , Inox ";
        String location = "Lucknow , Banarsh, Delhi, Pune, Bhopal";

        movieList.add(new Movie( "DDLJ", "Romantic", "SRK   ", 90000, theater, location,showTimings));
        movieList.add(new Movie( "Kick", "Avtion", "Slman   ", 70000 , theater, location,showTimings));
        movieList.add(new Movie( "K3G", "Love", "Amitabh   ", 85000, theater, location,showTimings));
        movieList.add(new Movie( "Hero", "Comedy", "Govinda   ", 50000, theater, location,showTimings));
        movieList.add(new Movie( "Raaz", "Horror", "Emraan   ", 65000, theater, location,showTimings));


        return movieList;
    }

    private static byte[] hexStringToByteArray(String s) {
        int len = s.length();
        byte[] data = new byte[len / 2];
        for (int i = 0; i < len; i += 2) {
            data[i / 2] = (byte) ((Character.digit(s.charAt(i), 16) << 4)
                    + Character.digit(s.charAt(i+1), 16));
        }
        return data;
    }

}
